import React, { useEffect } from 'react';


const Testing = () => {
    useEffect(() => {
        document.body.style.overflow = 'auto';
        document.body.style.touchAction = 'auto';
        document.body.style.overflow = 'auto';

        return () => {
        document.body.style.overflow = 'auto';
        document.body.style.touchAction = 'auto';
        document.body.style.overflow = 'auto';
        };
    }, []);

    return (
        <div style={{ position: 'fixed', marginTop:'100px', height: '50%', width: '100%', zIndex: '5'}}  >
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '50%', width: '100%', color: 'white' }}>
                <h1>Testing</h1>
            </div>


















            <div
  style={{
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    color: "white",
    gap: "10rem",
    marginTop: "50px",
  }}
>
<ul
                style={{
                display: 'flex',
                listStyleType: 'none',
                padding: 0,
                gap: '10rem',
                fontSize: '3px'
                }}
            >
                {/* Primer li con el efecto de destello */}
                <li>
                    <div className='dot__focused'></div>
                </li>
                <li>
                    <div className='dot'></div>
                </li>
                <li>
                    <div className='dot'></div>
                </li>
            </ul>
</div>









































        </div>
    );
    };

export default Testing;
